import React from "react";
import { Switch, Route, Link, Router } from "react-router-dom";
import "./App.css";
import NotFound from "./pages/404";
import Signin from "./pages/auth/login";

function App() {
  <Router>
    <Switch>
      <Route exact path="/" component={Signin} />
      <Route component={NotFound} />
    </Switch>
  </Router>;
}

export default App;
